import style from "./About.module.css"
const About = ()=>{
    
    return (
        <div className={style.container}>
         <p><h1 className={style.fuente}>Aplicacion Rick & Morty</h1>
         <h2 className={style.fuente}>MISION:</h2>
         <h3 className={style.fuente}>Este proyecto esta dedicado a poner en practica herramientas y conocimientos,
          vistos en el Modulo 2, de la carrera de Full Stack Development, dictada por Soy Henry</h3></p>
         <img className={style.imagen} src="https://blog.soyhenry.com/content/images/2021/02/HEADER-BLOG-NEGRO-01.jpg"/>
         <div>
            <h2 className={style.fuente}>Sobre mi</h2>
            <p><h3 className={style.fuente}>Soy Matias Javier Villagran, estudiante de Henry, vivo en la provincia de Santa Fe, 
                localizada en Argentina. Al momento de realiza esta app, me encontre con muchos desafios, pero con
                la ayuda de los instructores y compa√±eros, pude llevarla a cabo</h3></p>
         </div>
        </div>
    );
};

export default About;
